import React, {Component} from 'react';

class GoogleAuth extends Component {
  constructor (props) {
    super (props);
  }

  //load the OATH system from google -> use did mount lifecycle method for requests that should happen immediately on load
  componentDidMount () {
    window.gapi.load ('client:auth2'); //load up the oath library from googles API -> see video 217-218 in react course
  }

  render () {
    return <div>Hello</div>;
  }
}

export default GoogleAuth;
